e year 1955 Rubin Braunstein of the Radio Corporation of America initially accounted on infrared release from gallium arsenide and various supplementary semiconductor alloys.</p>\r\n<h6>\r\n	Benefits of LED Lights</h6>\r\n<p>\r\n	Following are the major advantages which LED lights posses as compared to traditional incandescent bulbs and compact fluorescent lights.</p>\r\n<h5>\r\n	Long Lasting</h5>\r\n<p>\r\n	LED bulbs last up to 10 times as long as compact fluorescent and far longer than typical incandescent bulbs.</p>\r\n<h5>\r\n	Durable</h5>\r\n<p>\r\n	Since LEDs do not have filament, they are not damaged under circumstances when a regular incandescent bulb would be broken. Because of their durability, LED bulbs hold up well to jarring and bumping.</p>\r\n<h5>\r\n	Cool</h5>\r\n<p>\r\n	LED bulbs do not cause heat build- up; LED produces 3.4 btu&#39;s/hour, compared to 85 for incandescent bulbs. This also cut down on air conditioning costs in homes &amp;offices.</p>\r\n<h5>\r\n	Mercury Free</h5>\r\n<p>\r\n	No Mercury is used in the manufacturing of LEDs.</p>\r\n<h5>\r\n	More Efficient</h5>\r\n<p>\r\n	LED light bulbs use only 2-10 watts of electricity (1/3rd to 1/30th of incandescent or CFL).Small LED flashlight bulbs will extend battery life 10 to 15 times longer than incandescent bulbs. Also, because there bulbs lasts for years, energy is saved in maintenance and replacement costs. For example, many cities in the US are replacing their incandescent traffic lights with LED arrays because the electricity cost can be reduced to 80% or more.</p>\r\n<h5>\r\n	Cost Effective</h5>\r\n<p>\r\n	Although LEDs are expensive, the cost is recouped over time due to energy savings, lower maintenance and replacement costs.</p>\r\n<h5>\r\n	Lights for Remote Areas</h5>\r\n<p>\r\n	Because of the low power requirement for LEDs, using solar panels becomes more practical and less expensive than running an electric line or using a generator for lightning.</p>\r\n<h4>\r\n	COLORS OF LED LIGHTS</h4>\r\n<h5>\r\n	Red</h5>\r\n<p>\r\n	Red is the traditional color for maintaining night vision.</p>\r\n<h5>\r\n	Green</h5>\r\n<p>\r\n	Green is now the preferred color of pilots and military. The green color is also great for retaining night vision, and it does not erase the red markings on maps and charts.</p>\r\n<h5>\r\n	Blue</h5>\r\n<p>\r\n	Many people like the blue because it is very easy on the eyes. Blue appears to be good reading light forelderly eyes. Elderly folks report that they can read under the blue light for hours without eyestrain, compared to severe eyestrain in less than 30 minutes with incandescent lightning.</p>\r\n<h5>\r\n	White</h5>\r\n<p>\r\n	White is the most popular of the LED colors. It produces a soft white light, without harsh reflection, glare or shadows.</p>\r\n<h5>\r\n	Amber</h5>\r\n<p>\r\n	LED amber bulbs do not attract flying insects, as do ordinary white bulbs. Amber LEDs are used outdoors in areas such as patios and decks wher insects flying around lights are a nuisance.</p>\r\n','0','Active','LED','led'),(17,17,'Solar','Solar','','<br />\r\n','<h6>\r\n	Solar</h6>\r\n<p>\r\n	QMMS established since 2014, is an energy solutions provider operating through Pakistan and Afghanistan offering services in solar, wind, hydro, and thermal sectors. The organization has worked countrywide from the deserts of Tharparkar to the valleys of Gilgit-Baltistan, leaving its footprint of environmental protection, social responsibility, renewable energy solutions and energy awareness throughout the country. It aims to create energy revolution in the country, whereby the vicious cycle of energy deficiency is broken, helping individuals becoming self reliant and progressive in their daily routines. Working with various national and international partners, the organization is committed towards providing customized, resource efficient solutions to all its clients, for a better and brighter Pakistan. Grace Solar is also a proud technical partner and offici